import {useRouter} from "next/router";

import {About, Header, Body} from 'styles/about';

export default () => {
    const router = useRouter();

    const yearsExperience = new Date().getFullYear() - 2015;

    return (
        <About>
            <Header>
                <h1>
                    Passion. Cutting Edge Technologies. Interaction. Creativity. Performant Code. Modern Architecture.
                </h1>
                <p>
                    You deserve it all.
                </p>
            </Header>


            <Body>
                <div className="about">
                    <h2>Hello,</h2>
                    <p>I am a driven full-stack developer with {yearsExperience} years of professional experience working at Macy's. I graduated from Cornell University with a degree in Information Science and another one in Fine Arts in May 2015.</p>
                </div>
            </Body>
        </About>
    );
}
